import Header from "./Header";


function Login(){
    return (
        <div>
            <Header/>
            welcome to login
            <br />
            UserName
            <input type="text" />
            <br />
            Password
            <input type="text" />
            <br />
            <button>Login</button>
        </div>
    )
}

export default Login;
